script: |
  super -f text -I q9430.spq | sort > q9430.out

inputs:
  - name: q9430.spq
    data: |
      SELECT DISTINCT - cor0.col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q9430.out
    data: |
      -3
      -64
      -80
